import "./Nav.css";
import { useState } from "react";
import Ac from "@material-ui/icons/Search";
import Mi from "@material-ui/icons/Menu";
const Nav = () => {
  const [hover, hoverfun] = useState(false);
  const dis = () => {
    hoverfun(true);
  };
  const dontdis = () => {
    hoverfun(false);
  };
  return (
    <div className="navmain">
      <div id="navsub">
        <div id="logo">
          <p id="mainlabel">
            TBB<sup id="sup">TM</sup>
          </p>
        </div>
        <div id="searchbar">
          <input id="navsearch" type="text" />

          <Ac id="searchicon" />
        </div>

        <div id="menubtn">
          <Mi id="mbtn" />
        </div>

        <div id="navitems">
          <div className="navitem1" onMouseEnter={dis} onMouseLeave={dontdis}>
            <p className="paraitem">Products</p>
          </div>
          <div id="navitem2">
            <p className="paraitem">Cart</p>
          </div>
          <div id="navitem3">
            <p className="paraitem">User</p>
          </div>
        </div>
      </div>
      {hover && <div className="onHover"></div>}
    </div>
  );
};

export default Nav;
